import React from 'react';
import styles from './Header.module.css';

const Header = () => {

  return (
    <div className={styles.header}>
      <span className={styles.headerLinks}>
        MENU
      </span>
      <span className={styles.headerLinks}>
        REWARDS
      </span>
      <span className={styles.headerLinks}>
        GIFT CARDS
      </span>
    </div>
  );
};

export default Header;
